import React from 'react'
import { useNavigate } from 'react-router-dom'

const About = () => {
  const navigate = useNavigate();
  return (
    <div>
      <h2>About</h2>
      <button onClick={()=> navigate("/")}>Home</button>
      <button onClick={()=> navigate("/contact")}>Contact</button>
    </div>
  )
}

export default About
